pragma solidity 0.8.17;

import "./Math.sol";
import "./Whitelist.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";


// ignore-file-swc-108

contract CoinMachine is Ownable, Math {
  receive() external payable {}

  // Events

  event CoinMachineInitialised();
  event TokensBought(address indexed buyer, uint256 numTokens, uint256 totalCost);
  event PeriodUpdated(uint256 activePeriod, uint256 currentPeriod);
  event PriceEvolutionSet(bool evolvePrice);
  event BeneficiarySet(address beneficiary);
  event CoinMachineStateSet(CoinMachineState state);
  event LimitOrderCreated(uint256 id, address indexed creator, uint256 purchasePrice, uint256 amountToSpend, uint256 executorFee);
  event LimitOrderExecuted(uint256 id, uint256 amountToSpend, uint256 executorFee);
  event LimitOrderCancelled(uint256 id);
  event CoinMachineDeleted(uint256 tokenBalance, uint256 purchaseTokenBalance, uint256 chainNativeTokenBalance);

  // Datatypes

   enum CoinMachineState { Active, Paused, Stopped }

   struct LimitOrder {
    address creator;
    uint256 purchasePrice; // Price to purchase at (or below)
    uint256 amountToSpend; // Number of tokens to spend
    uint256 executorFee; // Amount executor receives to fulfill the order
   }

  // Immutables

  address payable public immutable factory; // The coin machine factory address
  uint256 public immutable feeFraction; // The fraction defining the sale fee
  address public immutable wrappedToken; // If purchaseToken is chain-native token, use a wrapped token

  // Storage

  CoinMachineState public state; // The state of the coin machine

  address public token; // The token we are selling
  address public purchaseToken; // The token in which we receive payments, 0x0 for eth
  address payable public beneficiary; // Address to receive sale proceeds

  bool public evolvePrice; // If we should evolve the price or not
  bool public stoppable; // Whether the sale can be paused/stopped
  bool public allowLimitOrders; // Whether the sale supports limit orders
  bool public continuousSale; // Whether periods advance on sell-out

  uint256 public startTime; // Timestamp to begin the sale
  uint256 public endTime; // Timestamp to end the sale

  uint256 public periodLength; // Duration of a sale period in seconds (e.g. 3600 = 1 hour)
  uint256 public alpha; // WAD-denominated float between 0 and 1 that controls how quickly the EMA adjusts

  uint256 public targetPerPeriod; // Target number of tokens to sell in a period
  uint256 public maxPerPeriod; // Maximum number of tokens sellable in a period

  uint256 public activePeriod; // The active sale period
  uint256 public activePrice; // The active sale price (a WAD ratio of averageIntake / targetPerPeriod)

  uint256 public activeSold; // Tokens sold in the active period
  uint256 public activeIntake; // Payment received in the active period
  uint256 public emaIntake; // Averaged payment intake

  address public whitelist; // Address of an optional whitelist

  uint256 public minPurchaseFraction; // Minimum percent of supply a user can buy (in WADs)
  uint256 public userLimitFraction; // Limit an address can buy of the total supply (in WADs)
  uint256 soldTotalPastPeriods; // Total tokens sold by the coin machine, excluding current period
  mapping(address => uint256) public soldUser; // Tokens sold to a particular user

  uint256 totalIntakePastPeriods; // Total amount of purchaseToken we have received, excluding current period
  uint256 public intakeCap; // Maximum amount of purchaseToken we wish to recieve

  uint256 public limitOrderCount;
  mapping(uint256 => LimitOrder) public limitOrders; // Limit orders, stored by sequential id

  uint256 sellOutOffset;

  // Constructor

  constructor(address _owner, uint256 _feeFraction, address _wrappedToken) {
    factory = payable(msg.sender);
    feeFraction = _feeFraction;
    wrappedToken = _wrappedToken;
    startTime = type(uint256).max;
    transferOwnership(_owner);
  }

  // Modifiers

  modifier active() {
    require(isActive(), "coin-machine-not-active");
    _;
  }

  // Owner

  uint256 constant TOKEN_IDX = 0;
  uint256 constant PURCHASE_TOKEN_IDX = 1;
  uint256 constant START_TIME_IDX = 0;
  uint256 constant END_TIME_IDX = 1;
  uint256 constant PERIOD_LENGTH_IDX = 0;
  uint256 constant WINDOW_SIZE_IDX = 1;
  uint256 constant SALE_TARGET_IDX = 0;
  uint256 constant SALE_MAX_IDX = 1;
  uint256 constant BUY_MAX_IDX = 0;
  uint256 constant BUY_MIN_IDX = 1;
  uint256 constant STOPPABLE_IDX = 0;
  uint256 constant LIMIT_ORDERS_IDX = 1;
  uint256 constant CONTINUOUS_SALE_IDX = 2;

  /// @notice Must be called before any sales can be made
  /// @param _tokens The tokens we are selling and buying. Use 0x0 to buy Ether
  /// @param _times The times to start and end the sale
  /// @param _periodsParams Period length in seconds, and number of periods used in moving average. In the long-term, 86% of the weighting will be in this window size. The higher the number, the slower the price will be to adjust
  /// @param _targets The target and maximum number of tokens to sell per period
  /// @param _limits The maximum and minimum amount of tokens a user can purchase (as percent of total sold)
  /// @param _startingPrice The sale price to start at, expressed in units of _purchaseToken per token being sold, as a WAD
  /// @param _intakeCap The maximum amount of purchaseToken we wish to receive
  /// @param _options Whether or not the sale can be stopped, and whether to allow limit orders
  /// @param _beneficiary Address (payable) to send sale proceeds
  /// @param _whitelist Address of an optional whitelist
  function initialise(
    address[2] memory _tokens,
    uint256[2] memory _times,
    uint256[2] memory _periodsParams,
    uint256[2] memory _targets,
    uint256[2] memory _limits,
    uint256 _startingPrice,
    uint256 _intakeCap,
    bool[3] memory _options,
    address payable _beneficiary,
    address _whitelist
  )
    external
    onlyOwner
  {
    require(block.timestamp < startTime, "coin-machine-sale-begun");

    require(_tokens[TOKEN_IDX] != address(0x0), "coin-machine-invalid-token");
    require(_tokens[PURCHASE_TOKEN_IDX] != address(0x0) || wrappedToken != address(0x0), "coin-machine-invalid-token");
    require(_periodsParams[PERIOD_LENGTH_IDX] > 0, "coin-machine-period-too-small");
    require(_periodsParams[WINDOW_SIZE_IDX] > 0, "coin-machine-window-too-small");
    require(_periodsParams[WINDOW_SIZE_IDX] <= 512, "coin-machine-window-too-large");
    require(_targets[SALE_TARGET_IDX] > 0, "coin-machine-target-too-small");
    require(_targets[SALE_TARGET_IDX] <= _targets[SALE_MAX_IDX], "coin-machine-max-too-small");
    require(_limits[BUY_MAX_IDX] <= WAD, "coin-machine-limit-too-large");
    require(_limits[BUY_MAX_IDX] > 0, "coin-machine-limit-too-small");
    require(_limits[BUY_MAX_IDX] >= _limits[BUY_MIN_IDX], "coin-machine-limits-inconsistent");
    require(_startingPrice > 0, "coin-machine-price-too-small");
    require(_startingPrice <= type(uint128).max, "coin-machine-price-too-big");
    require(_intakeCap <= type(uint128).max, "coin-machine-cap-too-big");

    token = _tokens[TOKEN_IDX];
    purchaseToken = _tokens[PURCHASE_TOKEN_IDX];

    startTime = (_times[START_TIME_IDX] == 0) ? block.timestamp : _times[START_TIME_IDX];
    endTime = (_times[END_TIME_IDX] == 0) ? startTime + 180 days : _times[END_TIME_IDX];
    require(block.timestamp <= startTime, "coin-machine-bad-start-time");
    require(startTime < endTime, "coin-machine-bad-end-time");

    periodLength = _periodsParams[PERIOD_LENGTH_IDX];
    alpha = wdiv(2, _periodsParams[WINDOW_SIZE_IDX] + 1); // Two ints enter, 1 WAD leaves
    // In the long-term, 86% of the weighting will be in this window size. This is a 'standard' conversion
    // used between SMAs and EMAs, as the center of mass of the weightings is the same if this is used.

    targetPerPeriod = _targets[SALE_TARGET_IDX];
    maxPerPeriod = _targets[SALE_MAX_IDX];

    userLimitFraction = _limits[BUY_MAX_IDX];
    minPurchaseFraction = _limits[BUY_MIN_IDX];

    activePrice = _startingPrice;
    emaIntake = wmul(targetPerPeriod, _startingPrice);

    intakeCap = _intakeCap;
    stoppable = _options[STOPPABLE_IDX];
    allowLimitOrders = _options[LIMIT_ORDERS_IDX];
    continuousSale = _options[CONTINUOUS_SALE_IDX];

    setBeneficiary(_beneficiary);
    whitelist = _whitelist; // 0x0 if no whitelist is being used

    setCoinMachineState(CoinMachineState.Active);
    setPriceEvolution(getTokenBalance() > 0);

    emit CoinMachineInitialised();
  }

  /// @notice Pause the coin machine if active
  function pause() external onlyOwner {
    require(stoppable, "coin-machine-not-stoppable");
    require(state == CoinMachineState.Active, "coin-machine-not-active");
    setPriceEvolution(false);
    setCoinMachineState(CoinMachineState.Paused);
  }

  /// @notice Unpause the coin machine if paused
  function unpause() external onlyOwner {
    require(state == CoinMachineState.Paused, "coin-machine-not-paused");
    setCoinMachineState(CoinMachineState.Active);
    updatePeriod();
  }

  /// @notice Stop the coin machine (cannot be undone)
  function stop() external onlyOwner {
    require(stoppable, "coin-machine-not-stoppable");
    require(state != CoinMachineState.Stopped, "coin-machine-already-stopped");

    endTime = block.timestamp;
    setPriceEvolution(false);
    setCoinMachineState(CoinMachineState.Stopped);
  }

  /// @notice Delete the contract and send all remaining tokens to beneficiary, 30 days after sale ends
  function deleteContract() public onlyOwner {
    require(endTime + 30 days <= block.timestamp, "coin-machine-cannot-delete");

    // Withdraw leftover sale tokens
    uint256 tokenBalance = getTokenBalance();
    require(ERC20(token).transfer(beneficiary, tokenBalance), "coin-machine-transfer-failed");

    // Withdraw unclaimed purchase tokens
    address limitOrderPurchaseToken = getLimitOrderPurchaseToken();
    uint256 limitOrderPurchaseTokenBalance = ERC20(limitOrderPurchaseToken).balanceOf(address(this));
    require(ERC20(limitOrderPurchaseToken).transfer(beneficiary, limitOrderPurchaseTokenBalance), "coin-machine-transfer-failed");

    emit CoinMachineDeleted(tokenBalance, limitOrderPurchaseTokenBalance, address(this).balance);

    // Withdraw any native tokens and selfdestruct
    selfdestruct(beneficiary);
  }

  /// @notice Set the beneficiary address
  /// @param _beneficiary The beneficiary to receive sale proceeds
  function setBeneficiary(address payable _beneficiary) public onlyOwner {
    require(_beneficiary != address(0x0), "coin-machine-bad-beneficiary");
    beneficiary = _beneficiary;

    emit BeneficiarySet(_beneficiary);
  }

  // Public

  /// @notice Purchase tokens from Coin Machine.
  /// @param _numTokens The number of tokens to purchase
  function buyTokens(uint256 _numTokens, uint256 _maxPrice) external payable {
    updatePeriod();
    require(getCurrentPrice() <= _maxPrice, "coin-machine-bad-price");
    buyTokensFor(msg.sender, _numTokens, purchaseToken);
  }

  // Temporary placement to clarify the diff
  function buyTokensFor(
    address _recipient,
    uint256 _numTokens,
    address _purchaseToken
  )
    internal active
  {
    assert(activePeriod >= getCurrentPeriod());

    require(startTime <= block.timestamp, "coin-machine-sale-not-begun");
    require(block.timestamp < endTime, "coin-machine-sale-over");

    require(
      whitelist == address(0x0) || Whitelist(whitelist).isApproved(_recipient),
      "coin-machine-unauthorised"
    );

    uint256 maxPurchase = getMaxPurchase(_recipient);
    uint256 numTokens = min(maxPurchase, _numTokens);

    if (numTokens <= 0) {
      // This refund should only occur for direct purchases, never limit orders
      if (msg.value > 0) { payable(_recipient).transfer(msg.value); } // Refund any balance
      return;
    }

    uint256 totalCost = wmul(numTokens, activePrice);
    activeIntake += totalCost;

    // Do userLimitFraction bookkeeping (only if needed)
    if (userLimitFraction < WAD || minPurchaseFraction > 0) {
      uint256 minPurchase = getMinPurchase();
      soldUser[_recipient] += numTokens;
      require(soldUser[_recipient] >= minPurchase, "coin-machine-purchase-too-small");
    }

    activeSold += numTokens;
    assert(getTotalIntake() <= intakeCap);
    assert(activeSold <= maxPerPeriod);

    // Check if the contract is sold out
    if (numTokens >= getTokenBalance()) { setPriceEvolution(false); }

    // Check if the period is sold out, and if so to auto-advance
    if (activeSold == maxPerPeriod && continuousSale) {
      // slither-disable-next-line weak-prng
      uint256 periodElapsed = getSystemTime() % periodLength;
      sellOutOffset += periodLength - periodElapsed;
     }

    uint256 fee = wmul(totalCost, feeFraction);

    if (_purchaseToken == address(0x0)) {
      require(msg.value >= totalCost, "coin-machine-insufficient-funds");
      if (msg.value > totalCost) { payable(_recipient).transfer(msg.value - totalCost); } // Refund any balance
      factory.transfer(fee);
      beneficiary.transfer(totalCost - fee);
    } else {
      require(ERC20(_purchaseToken).transferFrom(_recipient, factory, fee), "coin-machine-purchase-failed");
      require(ERC20(_purchaseToken).transferFrom(_recipient, beneficiary, totalCost - fee), "coin-machine-purchase-failed");
    }

    require(ERC20(token).transfer(_recipient, numTokens), "coin-machine-transfer-failed");

    // slither-disable-next-line reentrancy-unlimited-gas
    emit TokensBought(_recipient, numTokens, totalCost);
  }

  /// @notice Create a limit order
  /// @param _purchasePrice The price (or below) at which you wish to purchase
  /// @param _amountToSpend The number of tokens you wish to spend
  /// @param _executorFee The fee you will pay to the executor
  function createLimitOrder(
    uint256 _purchasePrice,
    uint256 _amountToSpend,
    uint256 _executorFee
  )
    public
    active
  {
    require(allowLimitOrders, "coin-machine-limit-orders-disabled");
    require(ERC20(getLimitOrderPurchaseToken()).transferFrom(msg.sender, address(this), _executorFee), "coin-machine-fee-transfer-failed");

    limitOrderCount++;
    limitOrders[limitOrderCount] = LimitOrder(msg.sender, _purchasePrice, _amountToSpend, _executorFee);

    emit LimitOrderCreated(limitOrderCount, msg.sender, _purchasePrice, _amountToSpend, _executorFee);
  }

  /// @notice Execute the limit order and claim the fee
  /// @param _id The id of the limit order
  function executeLimitOrder(uint256 _id) public {
    require(_id <= limitOrderCount, "coin-machine-order-not-found");
    LimitOrder storage limitOrder = limitOrders[_id];

    updatePeriod();

    uint256 currentPrice = getCurrentPrice();
    require(currentPrice <= limitOrder.purchasePrice, "coin-machine-price-too-high");

    // Convert from amount to spend to amount to purchase using current price as denominator
    uint256 numTokens = min(
      wdiv(limitOrder.amountToSpend, currentPrice),
      getMaxPurchase(limitOrder.creator)
    );

    // Scale the fee by the % of the spend amount being fulfilled in this transaction
    uint256 amountToSpend = wmul(numTokens, currentPrice);
    uint256 executorFee = wmul(
      limitOrder.executorFee,
      wdiv(amountToSpend, limitOrder.amountToSpend)
    );

    limitOrder.amountToSpend = limitOrder.amountToSpend - amountToSpend;
    limitOrder.executorFee = limitOrder.executorFee - executorFee;

    address creator = limitOrder.creator;
    if (limitOrder.amountToSpend <= 1) { delete limitOrders[_id]; } // <= 1 due to rounding error

    address limitOrderPurchaseToken = getLimitOrderPurchaseToken();
    assert(limitOrderPurchaseToken != address(0x0));

    require(ERC20(limitOrderPurchaseToken).transfer(msg.sender, executorFee), "coin-machine-fee-transfer-failed");

    if (ERC20(limitOrderPurchaseToken).allowance(creator, address(this)) >= amountToSpend) {
      buyTokensFor(creator, numTokens, limitOrderPurchaseToken);
    }

    // slither-disable-next-line reentrancy-unlimited-gas
    emit LimitOrderExecuted(_id, amountToSpend, executorFee);
  }

  /// @notice Cancel the limit order and if the sale is over, reclaim the fee
  /// @dev Can only be called by order creator
  /// @param _id The id of the limit order
  function cancelLimitOrder(uint256 _id) public {
    require(limitOrders[_id].creator == msg.sender, "coin-machine-not-order-creator");

    uint256 executorFee = limitOrders[_id].executorFee;

    delete limitOrders[_id];

    address cancelBeneficiary = (endTime <= block.timestamp) ? msg.sender : beneficiary;
    require(ERC20(getLimitOrderPurchaseToken()).transfer(cancelBeneficiary, executorFee), "coin-machine-fee-transfer-failed");

    emit LimitOrderCancelled(_id);
  }

  /// @notice Bring the token accounting current
  function updatePeriod() public {
    uint256 currentPeriod = getCurrentPeriod();

    assert(activePeriod <= currentPeriod);

    if (activePeriod < currentPeriod) {
      uint256 initialActivePeriod = activePeriod;

      // If we're out of tokens or deprecated, don't update the price
      if (!evolvePrice) {
        setPriceEvolution(getTokenBalance() > 0 && isActive());
      } else {
        emaIntake = wmul((WAD - alpha), emaIntake) + wmul(alpha, activeIntake); // wmul(wad, int) => int

        // Handle any additional missed periods
        uint256 periodGap = currentPeriod - initialActivePeriod - 1;
        if (periodGap != 0) {
          emaIntake = wmul(wpow((WAD - alpha), periodGap), emaIntake);
        }

        // Update the price (minimum 1 WEI)
        activePrice = max(wdiv(emaIntake, targetPerPeriod), 1);
      }

      // Update the global counters
      totalIntakePastPeriods += activeIntake;
      soldTotalPastPeriods += activeSold;

      // Set the new active period params
      activePeriod = currentPeriod;
      activeIntake = 0;
      activeSold = 0;

      emit PeriodUpdated(initialActivePeriod, currentPeriod);
    }
  }

  // View

  /// @notice Get the current price per token
  function getCurrentPrice() public view returns (uint256) {
    uint256 currentPeriod = getCurrentPeriod();

    if (activePeriod >= currentPeriod || !evolvePrice) {
      return activePrice;

    // Otherwise, infer the new price
    } else {
      uint256 newIntake = emaIntake;

      // Accommodate the activePeriod
      newIntake = wmul((WAD - alpha), newIntake) + wmul(alpha, activeIntake);

      // Accommodate periods between the activePeriod and the currentPeriod
      uint256 periodGap = currentPeriod - activePeriod - 1;
      if (periodGap != 0) {
        newIntake = wmul(wpow((WAD - alpha), periodGap), newIntake);
      }

      // Min price is 1 WEI
      return max(wdiv(newIntake, targetPerPeriod), 1);
    }
  }

  /// @notice Get the remaining balance of tokens
  function getTokenBalance() public view returns (uint256) {
    return ERC20(token).balanceOf(address(this));
  }

  /// @notice Get the number of remaining tokens for sale this period
  function getSellableTokens() public view returns (uint256) {
    return min(
      maxPerPeriod - ((activePeriod >= getCurrentPeriod()) ? activeSold : 0),
      wdiv(intakeCap - getTotalIntake(), getCurrentPrice()) // Get number of tokens we can sell before we hit the cap
    );
  }

  /// @notice Get the minimum amount of tokens a user can purchase
  function getMinPurchase() public view returns (uint256) {
    return wmul(minPurchaseFraction, getSoldTotal() + getTokenBalance());
  }

  /// @notice Get the maximum amount of tokens a user can purchase in a period
  function getMaxPurchase(address _user) public view returns (uint256) {
    uint256 tokenBalance = getTokenBalance();
    uint256 sellableTokens = getSellableTokens();
    uint256 userLimit = getUserLimit(_user);
    return min(userLimit, min(tokenBalance, sellableTokens));
  }

  /// @notice Get the maximum amount of tokens a user can purchase in total
  function getUserLimit(address _user) public view returns (uint256) {
    return
      (userLimitFraction == WAD || whitelist == address(0x0)) ?
      type(uint256).max :
      wmul(getTokenBalance() + getSoldTotal(), userLimitFraction) - soldUser[_user]
    ;
  }

  /// @notice Get the total amount of purchaseToken received so far
  function getTotalIntake() public view returns (uint256) {
    return totalIntakePastPeriods + activeIntake;
  }

  /// @notice Get the total amount of token sold so far
  function getSoldTotal() public view returns (uint256) {
    return soldTotalPastPeriods + activeSold;
  }

  /// @notice Get the current period based on the system time
  function getCurrentPeriod() public view returns (uint256) {
    return getSystemTime() / periodLength;
  }

  /// @notice Get the limit order purchase token
  function getLimitOrderPurchaseToken() public view returns (address) {
    return (purchaseToken == address(0x0)) ? wrappedToken : purchaseToken;
  }

  // Internal

  function setCoinMachineState(CoinMachineState _state) internal {
    state = _state;

    emit CoinMachineStateSet(_state);
  }

  function isActive() internal view returns (bool) {
    return state == CoinMachineState.Active;
  }

  function setPriceEvolution(bool _status) internal {
    if (_status != evolvePrice) {
      evolvePrice = _status;

      emit PriceEvolutionSet(_status);
    }
  }

  function getSystemTime() internal view returns (uint256) {
    return (max(block.timestamp + sellOutOffset, startTime) - startTime);
  }
}

